import React from "react";
import items from "./Items";

const FoodItems = () => {
  return (
    <>
      {console.log(items, "jakkaka")}
      <ul>
        {items?.map((item) => (
          <div className="item" key={item.id}>
            <li>{item?.name}</li>
            <li>{item?.price}</li>
            <li>{item?.origin}</li>
          </div>
        ))}
      </ul>
    </>
  );
};

export default FoodItems;
